const Header = () => {
  return (
    <>
      <div className="header col-lg-1">
        <h1>TinyURL Clone</h1>
      </div>
      <div className="col-lg-11">hey</div>
      <div class="container">
        <div class="row">
          <div class="col">1 of 2</div>
          <div class="col">2 of 2</div>
        </div>
        <div class="row">
          <div class="col">1 of 3</div>
          <div class="col">2 of 3</div>
          <div class="col">3 of 3</div>
        </div>
      </div>
    </>
  );
};

export default Header;
